Storyline:

    The movie follows the adventures and travels of four petty criminals in 1873 Utah whom include gambler and swindler Stubby Preston, pregnant prostitute Bunny O'Neal, drunkard Clem, and a mental disturbed man, named Bud, who's obsessed with the dead. The quartet travel aimlessly through the Utah Badlands looking for food, water and people to swindle, while they are harassed by a villainous Mexican bandit, named Chaco, whom Stubby vows revenge after the bandito sexually assaults Bunny.



